def get_file(filedir='excel_reports', filename=sample_file, company=''):

    if not os.path.exists(filedir):
        os.mkdir(filedir)
        out_wb, out_ws = get_sample_wb_and_ws()
        for i in range(2, 24):
            out_ws[i][1].value = company
        out_wb.save(filename)

    elif not os.path.exists(filename):
        out_wb, out_ws = get_sample_wb_and_ws()
        for i in range(2, 24):
            out_ws[i][1].value = company
        out_wb.save(filename)

    else:
        out_wb = load_workbook(filename=filename)
        out_ws = out_wb['Sheet1']

    return out_wb, out_ws


def get_sample_wb_and_ws(location=sample_file):
    wb = load_workbook(filename=sample_file)
    ws = wb['Sheet1']
    return wb, ws


